class Spell:

  async def getClasses(self):
    return self.classes

  async def getCurrentEras(self):
    return self.era

  async def getUniqueEras(self):
    uniqueEra = {}
    for aSpell in self.list:
      myEra = self.list[aSpell]["Era"]
      
      if not myEra in uniqueEra:
        uniqueEra[myEra] = None

    for aEra in uniqueEra:
      print(aEra)

    return uniqueEra

  async def getSpellsByClassLevel(self, pClass, pLevel):
    #Make a complete spell list class and level
    myList = {}
    
    for aSpell in self.list:
      myClass = self.list[aSpell]["Class"]
      myName = self.list[aSpell]["Name"]
      myLevel = self.list[aSpell]["Level"]

      #print(pClass, myClass)
      if pClass == myClass:
        print("Is it a match? {}=={}".format(pLevel, myLevel))
        if int(pLevel) == int(myLevel):
          print("Yup")
        else:
          print("Nope")

      #Check if this spell is for this class and level
      if pClass == myClass and int(pLevel) == int(myLevel):
        #print("myKey ({})".format(myKey))
        howToGet = await self.Preferred(aSpell)
        myList[myName] = howToGet

    return myList


  async def compare(self, pClass, pSpellBook):
    #Make sure class has proper capitalization
    pClass=pClass.capitalize()
    
    #Make a complete spell list for this class.
    myList = {}
    for aSpell in self.list:
      myClass = self.list[aSpell]["Class"]
      myName = self.list[aSpell]["Name"]
      #Check if this spell is for this classmethod
      if myClass.lower() in pClass.lower():
        print(myClass)
        myList[myName] = None
    
    #Flag spells in the list that already in pSpellBook
    for aSpell in pSpellBook:
      if aSpell in myList:
        myList[aSpell] = "Got It"
        print("Got it: {}".format(aSpell))
    
    myMsg = ""
    #Iterate items that still remain
    for aSpell in myList:
      if myList[aSpell] is None:
        print("Don't got it: {}".format(aSpell))
        
        myKey = "{}_{}".format(pClass,aSpell)

        #Get data for this spell
        myClass = self.list[myKey]["Class"]
        myLevel = self.list[myKey]["Level"]
        myName = self.list[myKey]["Name"]
        myEra = self.list[myKey]["Era"]
        howToGet = await self.Preferred(myKey)

        #Setup a line for this spell
        thisMsg = "{} ({}): {} ({}) - {}".format(myClass, myLevel, myName, myEra, howToGet) 
        
        #Add this line to the message
        myMsg += "{}\r".format(thisMsg)

    #Return the spells
    return myMsg
      
      
  async def Preferred(self, pSpell):
    if len(self.list[pSpell]['PoK Vendor']) > 0:
      myReturn = "PoK {}".format(self.list[pSpell]['PoK Vendor'])
      return myReturn
    if len(self.list[pSpell]['Turn In']) > 0:
      myReturn = "Turn In {}".format(self.list[pSpell]['Turn In'])
      return myReturn
    if len(self.list[pSpell]['Quest URL']) > 0:
      myReturn = "Quest {}".format(self.list[pSpell]['Quest URL'])
      return myReturn
    if len(self.list[pSpell]['Drop  URL']) > 0:
      myReturn = "Drop {}".format(self.list[pSpell]['Drop  URL'])
      return myReturn
    if len(self.list[pSpell]['Research URL']) > 0:
      myReturn = "Research {}".format(self.list[pSpell]['Research URL'])
      return myReturn
    if len(self.list[pSpell]['Vendor URL']) > 0:
      myReturn = "Vendor {}".format(self.list[pSpell]['Vendor URL'])
      return myReturn
    else:
      return "TBD"



